IF OBJECT_ID('dbo.proc_transform_343', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_343;
GO
CREATE PROCEDURE dbo.proc_transform_343
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_343
    SET payload = LEFT(payload, 1000) + N'|V4-343|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_343;
END
